import React, { Component } from 'react';

import Head from 'next/head';

class TeamsHeader extends Component {
    render() {
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" />
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <main className="main">
                    <ul className="breadcrumbs container">
                        <li><a href="#">Home</a></li>
                        <li className="current"><a href="#">Elevate by Aesthetic Record</a></li>
                    </ul>
                    <div className="banner">
                        <div className="container">
                            <img src="/banner.jpg" alt="Image Description" />
                            <span className="img-shape">
                                <img src="/icon-leaf.png" alt="image description" />
                            </span>
                        </div>
                    </div>
                </main>
            </div>
        );
    }
}

export default TeamsHeader;
